import ProductList from './pages/ProductList'
import { BrowserRouter, Routes, Route, Link } from "react-router-dom"


function App() {
  return (
    <BrowserRouter>
      <Header />
      <div className="App">
        <Routes>
          <Ro/>
          <ProductList />
          <Bookmark />
        </Routes>
      </div>
      <Footer />
    </BrowserRouter>
  );
}

export default App;
